import React, { Component } from 'react';
import './table.css';
import Axios from 'axios';
// import { get } from 'https';
export default class Menu extends Component {
    constructor(props) {
        super(props);
        this.bindData = this.bindData.bind(this);
        this.state = {
            orders: {
                name: '',
                quantity: '',
                created: '',
                predicted: '',
                status: '',
            },
            data:[],
        }
    }

    componentDidMount() {
        this.bindData();
    }

    bindData() {
        Axios({
            method: "get",
            url: 'http://localhost:8088/getData',
            responseType: "json"

        }).then((response) => {
            console.log(response.data)

            this.setState({
                data:response.data
            })
        })
    }
    render() {

            let tbody = this.state.data.map((element)=>{
                return (
                    <tr>x
                    <td>{element.name}</td>
                    <td>{element.quantity}</td>
                    <td>{element.created}</td>
                    <td>{element.predicted}</td>
                    <td>{element.status}</td>
                  </tr>
                )
            })


        return (
            <React.Fragment>
                <h2>Orders</h2>

                <table>
                    <thead>
                    <tr>
                        <th>Name</th>
                        <th>Quantity</th>
                        <th>Created</th>
                        <th>Predicted</th>
                    </tr>
                    </thead>
                    <tbody>

                    </tbody>
                    <tr>
                        
                        <td>Alfreds Futterkiste</td>
                        <td>Maria Anders</td>
                        <td>Germany</td>
                    </tr>
                    <tr>
                        <td>Centro comercial Moctezuma</td>
                        <td>Francisco Chang</td>
                        <td>Mexico</td>
                    </tr>
                    <tr>
                        <td>Ernst Handel</td>
                        <td>Roland Mendel</td>
                        <td>Austria</td>
                    </tr>
                    <tr>
                        <td>Island Trading</td>
                        <td>Helen Bennett</td>
                        <td>UK</td>
                    </tr>
                    <tr>
                        <td>Laughing Bacchus Winecellars</td>
                        <td>Yoshi Tannamuri</td>
                        <td>Canada</td>
                    </tr>
                    <tr>
                        <td>Magazzini Alimentari Riuniti</td>
                        <td>Giovanni Rovelli</td>
                        <td>Italy</td>
                    </tr>
                </table>
            </React.Fragment>
        )
    }

}
